import React, { Component } from 'react';
import axios from 'axios';

export default class Create extends Component {
    constructor(props) {
        super(props);

        this.onChangeRank = this.onChangeRank.bind(this);
        this.onChangeCountry = this.onChangeCountry.bind(this);
        this.onChangeDate = this.onChangeDate.bind(this);
        this.onChangeSongArtist = this.onChangeSongArtist.bind(this);
        this.onChangeSongTitle = this.onChangeSongTitle.bind(this);
        this.onSubmit = this.onSubmit.bind(this);

        this.state = {
            rank: "",
            country: "Global",
            date: "",
            song_artist: "",
            song_title: ""
        };
    };

    onChangeRank(e) {
        this.setState({
            rank: e.target.value,
        });
    };

    onChangeCountry(e) {
        this.setState({
            country: e.target.value,
        });
    };

    onChangeDate(e) {
        this.setState({
            date: e.target.value,
        });
    };

    onChangeSongArtist(e) {
        this.setState({
            song_artist: e.target.value,
        });
    };

    onChangeSongTitle(e) {
        this.setState({
            song_title: e.target.value,
        });
    };

    onSubmit(e) {
        const newRecord = {
            rank: this.state.rank,
            country: this.state.country,
            date: this.state.date,
            song_artist: this.state.song_artist,
            song_title: this.state.song_title,
        };

        axios
            .post("http://localhost:5000/posts/create", newRecord);

        this.setState({
            rank: "",
            country: "Global",
            date: "",
            song_artist: "",
            song_title: ""
        });
    };

    render() {
        return (
            <div>
                <form onSubmit={this.onSearch}>
                    <input
                        type="number"
                        placeholder="Rank"
                        className="form-control"
                        min="1"
                        max="200"
                        value={this.state.rank}
                        onChange={this.onChangeRank}
                    />
                </form>
            </div>
        );
    };
};
